INSERT INTO `ads_types` VALUES (1,'redirect','a:2:{s:2:\"ru\";s:8:\"Redirect\";s:2:\"en\";s:8:\"Redirect\";}','a:2:{s:2:\"ru\";s:364:\"При попадании на сайт пользователь сразу перенаправляется на рекламную ссылку. Есть возможность регулировки уникальности пользователя, чтобы показывать рекламу только один раз. Наиболее профитен.\";s:2:\"en\";s:148:\"After entering site user immediatedly redirected to ads link. Regulation of user uniqueness is available to show ads only one time. Most profitable.\";}',1,1,3,5,1544010194,1544010194,1,1),(2,'clickunder','a:2:{s:2:\"ru\";s:10:\"ClickUnder\";s:2:\"en\";s:10:\"ClickUnder\";}','a:2:{s:2:\"ru\";s:263:\"Второй по профитности. Юзеру будет показана реклама после клика в любом месте сайта, при этом юзер получает контент, находящийся на вашем сайте.\";s:2:\"en\";s:139:\"Second best at profitability. Ads will be shown to user after click in any area of site, in same time user will get content from your site.\";}',0,1,4,4,1544010194,1544010194,1,1),(3,'dialog','a:2:{s:2:\"ru\";s:14:\"FullScreen Ads\";s:2:\"en\";s:14:\"FullScreen Ads\";}','a:2:{s:2:\"ru\";s:599:\"Уведомление, которое показывается пользователю при попадании на ваш сайт. Выглядит так:  <a href=\"/img/dialog_example.png\" target=\"_blank\" data-pjax=\"0\">пример</a> У пользователя есть выбор - остаться на сайте или уйти. Наименее профитный способ слива, но наиболее лояльный к пользователю. Есть возможность индивидуальной настройки уведомления под ваш сайт.\";s:2:\"en\";s:319:\"Notice is shown to the user in contact with your website. Looks: <a href=\"/img/dialog_example.png\" target=\"_blank\" data-pjax=\"0\">example</a> The user has a choice - to stay on the site or go. Least of profitable way to drain, but the most loyal to the user. It is possible to customize the notifications for your site.\n\";}',0,0,5,4,1544010194,1544010194,1,1),(4,'push','a:2:{s:2:\"ru\";s:7:\"PushAds\";s:2:\"en\";s:7:\"PushAds\";}','a:2:{s:2:\"ru\";s:572:\"Уведомление, которое показывается пользователю при попадании на ваш сайт. Выглядит так: <a href=\"/img/push_example.png\" target=\"_blank\" data-pjax=\"0\">пример</a>. Тем самым это не является жестким редиректом, но у пользователя нет выбора, кроме как нажать кнопку Продолжить. Есть возможность индивидуальной настройки уведомления под ваш сайт.\";s:2:\"en\";s:292:\"Notice is shown to the user in contact with your website. Looks: <a href=\"/img/push_example.png\" target=\"_blank\" data-pjax=\"0\">example</a>. Thus, it is not hard redirect, but the user has no choice but to press the Continue button. It is possible to customize the notifications for your site.\";}',0,2,5,3,1544010194,1544010194,1,1),(5,'click_n_confirm','a:2:{s:2:\"ru\";s:13:\"Click&Confirm\";s:2:\"en\";s:13:\"Click&Confirm\";}','a:2:{s:2:\"ru\";s:42:\"ClickUnder с confirm-сообщением\";s:2:\"en\";s:23:\"ClickUnder with confirm\";}',0,1,5,4,1544010203,1544010203,1,1),(6,'replace_links','a:2:{s:2:\"ru\";s:25:\"Замена ссылок\";s:2:\"en\";s:13:\"Replace links\";}','a:2:{s:2:\"ru\";s:51:\"Заменяет ссылки на странице\";s:2:\"en\";s:21:\"Replace links on page\";}',0,2,4,4,1544010211,1544010211,1,1);
