INSERT INTO `faqs` VALUES (1,'a:2:{s:2:\"ru\";s:44:\"Что такое вапклик (wapclick)?\";s:2:\"en\";s:17:\"What is wapclick?\";}','a:2:{s:2:\"ru\";s:455:\"Вапклик - это технология оплаты контента на сайте без ввода номера и кода подтверждения. Это легальный способ монетизации мобильного трафика, при котором абонент соглашается со стоимость и условиями подписки нажимая кнопку “ОК” или “Загрузить”.\";s:2:\"en\";s:260:\"Wapclick - is a payment technology content on the site without entering a number and confirmation code. This is a legitimate way to monetize mobile traffic, in which the subscriber agrees with the terms of the subscription cost and pressing \"OK\" or \"Download.\"\";}',1,1,1),(2,'a:2:{s:2:\"ru\";s:45:\"Как происходит подписка?\";s:2:\"en\";s:24:\"How is the subscription?\";}','a:2:{s:2:\"ru\";s:518:\"Пользователь заходит на платник нужной тематики, с мобильного телефона или смартфона. Выбирает интересующий его контент и нажимает кнопку “ОК”, тем самым соглашаясь со стоимостью и правилами подписки. После успешной подписки пользователь получает ссылку для скачивания контента.\";s:2:\"en\";s:259:\"The user enters the desired paysite theme, mobile phone or smartphone. Selects the interest of its content, and clicks \"OK\", thus agreeing with the value and the subscription rules. After successful subscription the user receives a link to a content download.\";}',2,1,1),(3,'a:2:{s:2:\"ru\";s:50:\"В чем преимущества вапклик?\";s:2:\"en\";s:33:\"What are the advantages wapclick?\";}','a:2:{s:2:\"ru\";s:850:\"Вапклик имеет множество преимуществ, среди которых хотелось бы выделить:<br />\n- Абсолютно легальная схема работы, полностью согласованная с ОСС.<br />\n- Отличный конверт, т.к пользователю не требуется вводить номер телефона либо скачивать мидлет для активации подписки.<br />\n- Хороший доход на длинной дистанции. В отличии от смс подписка будет нести доход в течении нескольких месяцев.<br />\n- Отсутствие фрода и штрафов со стороны операторов, при соблюдении правил работы.\";s:2:\"en\";s:466:\"Wapclick has many advantages, among which we would like to highlight:<br />\n- Absolutely legal scheme of work, fully compatible with the OSS.<br />\n- Excellent envelope, because the user does not need to enter a phone number or to download the MIDlet to activate the subscription.<br />\n- A good income in the long run. Unlike SMS subscription will incur income for several months.<br />\n- Absence of fraud and fines from the operators in compliance with work rules.\";}',3,1,1),(4,'a:2:{s:2:\"ru\";s:35:\"Что такое платники?\";s:2:\"en\";s:18:\"What is a paysite?\";}','a:2:{s:2:\"ru\";s:415:\"Платник - это целевая страница (согласованная с ОСС), на которую попадает пользователь с вашего сайта либо рекламной сети. На платнике содержится информация об услуге и тип контента который получит пользователь после подписки.\";s:2:\"en\";s:230:\"Paysites - a landing page (compatible with the OSS), on which the user gets to your website or ad network. On paysites contains information about the service and the type of content that a user will receive after the subscription.\";}',4,1,1),(5,'a:2:{s:2:\"ru\";s:41:\"Какой платник выбрать?\";s:2:\"en\";s:24:\"Which paysite to choose?\";}','a:2:{s:2:\"ru\";s:480:\"Обязательно нужно использовать платники подходящие по тематике под ваш трафик. Так например, если у вас музыкальный портал то необходимо использовать музыкальный платник. Операторы категорически запрещают использовать для adult трафика платники других тематик.\";s:2:\"en\";s:221:\"Be sure to use paysite suitable topics for your traffic. For example, if you have a music portal it is necessary to use the music paysite. Operators categorically prohibit the use of adult paysite traffic of other topics.\";}',5,1,1),(6,'a:2:{s:2:\"ru\";s:53:\"Какие операторы принимаются?\";s:2:\"en\";s:28:\"What operators are accepted?\";}','a:2:{s:2:\"ru\";s:446:\"На данный момент ПП принимает большую тройку ОСС по России (МТС, Билайн, Мегафон), а так же Францию и Азербайджан. При этом мы постоянно работаем над увеличением зоны покрытия, и по мере согласования новых стран, будем сообщать об этом в новостях.\";s:2:\"en\";s:247:\"At present PP takes big three OSS in Russia (MTS, Beeline, Megafon), as well as France and Azerbaijan. At the same time we are constantly working to increase the coverage area, and as the approval of new countries will report about it in the news.\";}',1,1,2),(7,'a:2:{s:2:\"ru\";s:69:\"Какие категории трафика принимает ПП?\";s:2:\"en\";s:44:\"What are the categories of traffic takes PP?\";}','a:2:{s:2:\"ru\";s:873:\"Партнерская программа принимает все согласованные категории трафика кроме:<br />\n- траффика добытого с помощью вредоносных и троянских программ, а так же с помощью подмены выдачи<br />\n- подмены лицензионного контента: skype/viber/whatsapp/opera итд<br />\n- спама в любой форме, включая sms и email рассылку<br />\n- трафика с ресурсов содержащих: детскую порнографию, информацию о любых наркотиках, экстремистские либо другие запрещенные к публикации материалы.<br />\n- траффика с взломанных сайтов и шеллов\";s:2:\"en\";s:502:\"Affiliate program accepts all agreed except for traffic category:<br />\n- Traffic produced via malware and Trojans, as well as with the help of the substitution of issue<br />\n- Substitution of licensed content: skype / viber / whatsapp / opera etc.<br />\n- Any form of spam, including sms and email newsletter<br />\n- Traffic resources containing: child pornography, information on any drugs, extremist or other prohibited materials for publication.<br />\n- Traffic to compromised Web sites and shells\";}',2,1,2),(8,'a:2:{s:2:\"ru\";s:70:\"Какие платформы поддерживает вапклик?\";s:2:\"en\";s:33:\"Which platforms supports waplick?\";}','a:2:{s:2:\"ru\";s:293:\"В отличии от мидлетов – вапклик поддерживает практически все мобильные устройства, начиная от кнопочных телефонов, заканчивая современными смартфонами и Iphone.\";s:2:\"en\";s:126:\"Unlike MIDlet - wapclick supports virtually every mobile device, from the push-button phones to modern smartphones and Iphone.\";}',3,1,2),(9,'a:2:{s:2:\"ru\";s:59:\"Для чего нужна парковка доменов?\";s:2:\"en\";s:20:\"What is the parking?\";}','a:2:{s:2:\"ru\";s:552:\"Парковка доменов позволяет вам использовать свои домены для работы с партнерской программой. Это позволяет увеличить конверт, за счет снижения рисков бана системных доменов антивирусами, и других форс-мажорных обстоятельствах. Рекомендуем переодически следить за припарковаными доменами на бан АВ.\";s:2:\"en\";s:267:\"Parking allows you to use your domain to work with the affiliate program. This makes it possible to increase the envelope, by reducing the risk of systemic ban domains antivirus, and other force majeure. We recommend periodically monitor the parked domains to ban AB.\";}',4,1,2),(10,'a:2:{s:2:\"ru\";s:75:\"Зачем нужно указывать источники трафика?\";s:2:\"en\";s:49:\"Why do we need to specify the sources of traffic?\";}','a:2:{s:2:\"ru\";s:285:\"Согласно требованиям ОСС – все источники трафика должны проходить обязательную модерацию. Как правило модерация занимает не более 5 часов в рабочее время.\";s:2:\"en\";s:157:\"According to the requirements of the OSS - all traffic sources must undergo mandatory moderation. Typically approval takes less than 5 hours of working time.\";}',5,1,2),(11,'a:2:{s:2:\"ru\";s:79:\"Как настроить слив трафика со своего сайта?\";s:2:\"en\";s:40:\"How to set drain traffic from your site?\";}','a:2:{s:2:\"ru\";s:392:\"Вы можете настроить слив траффика со своего сайта используя .htaccess код либо javascript скрипт. В данном случае все принимаемые операторы будут автоматически перенаправляться на заданные платники партнерской программы.\";s:2:\"en\";s:200:\"You can adjust the drain traffic from the site using .htaccess code or javascript script. In this case, all operators will be taken automatically redirected to the specified paysite affiliate program.\";}',6,1,2),(12,'a:2:{s:2:\"ru\";s:50:\"Для чего нужны субаккаунты?\";s:2:\"en\";s:25:\"What are the subaccounts?\";}','a:2:{s:2:\"ru\";s:361:\"Субаккаунты служат для разделения статистики и анализа трафика. Вы можете настроить слив с разных разделов сайта по разным субаккаунтам, и отслежить конверсию по каждому отдельно взятому разделу.\";s:2:\"en\";s:212:\"Subaccounts serve to separate statistics and traffic analysis. You can customize the sink with different sections of the site for different subaccounts, and monitored by the conversion of each individual section.\";}',7,1,2),(13,'a:2:{s:2:\"ru\";s:96:\"Как отследить конверсии для максимального конверта?\";s:2:\"en\";s:57:\"How to track conversions for the maximum of the envelope?\";}','a:2:{s:2:\"ru\";s:348:\"Для максимально эффективного анализа трафика и площадок советуем воспользоваться инструментом “пингбек”, который позволяет интегрировать статистику в вашем трекере по каждому переходу.\";s:2:\"en\";s:160:\"To maximize the traffic analysis sites and recommend you to use our \"pingbek\" which allows you to integrate this information on your tracker at each transition.\";}',8,1,2),(14,'a:2:{s:2:\"ru\";s:46:\"Для чего нужен трафикбек?\";s:2:\"en\";s:24:\"What is the trafficback?\";}','a:2:{s:2:\"ru\";s:319:\"Трафикбек нужен для возврата не принимаемого траффика. Чтобы трафик не терялся вы можете перенаправить его в другие партнерские программы, либо сделать возврат на свой сайт.\";s:2:\"en\";s:153:\"Trafficback not need to return the received traffic. To traffic is not lost, you can redirect it to other affiliate programs or make refund to your site.\";}',9,1,2),(15,'a:2:{s:2:\"ru\";s:56:\"Какой доход приносит подписка?\";s:2:\"en\";s:34:\"Which brings subscription revenue?\";}','a:2:{s:2:\"ru\";s:209:\"В среднем подписка в долгосрочной перспективе приносит от 40 до 150 рублей в зависимости от тарификации и оператора.\";s:2:\"en\";s:107:\"The average subscription in the long run brings from 40 to 150 rubles depending on the operator and tariff.\";}',1,1,3),(16,'a:2:{s:2:\"ru\";s:47:\"Когда происходят выплаты?\";s:2:\"en\";s:23:\"When the payment occur?\";}','a:2:{s:2:\"ru\";s:122:\"Выплаты производятся каждую среду за предыдущую расчетную неделю.\";s:2:\"en\";s:67:\"Payments are made every Wednesday for the previous week calculated.\";}',2,1,3),(17,'a:2:{s:2:\"ru\";s:68:\"Какой размер партнерских отчислений?\";s:2:\"en\";s:42:\"What is the size of partner contributions?\";}','a:2:{s:2:\"ru\";s:237:\"По умолчанию размер партнерских отчислений составляет 85%, но может варьироваться в индивидуальном порядке, для каждого партнера.\";s:2:\"en\";s:103:\"The default size of partner contributions is 85%, but may vary on an individual basis for each partner.\";}',3,1,3),(18,'a:2:{s:2:\"ru\";s:77:\"Какую стоимость использовать на лендинге?\";s:2:\"en\";s:36:\"What is the cost to use the Landing?\";}','a:2:{s:2:\"ru\";s:712:\"В ПП есть 2 вида тарификации, с ежедневными и единоразовыми списаниями. При ежедневных списаниях стоимость для пользователя варьируется от 20 до 30 рублей. Хороший конверт показывают обе тарификации. При единоразовых списаниях есть возможность устанавливать произвольную цену от 50 до 500 рублей. В зависимости от качества трафика оптимальная цена для единоразового ребила будет 150-250 рублей.\";s:2:\"en\";s:367:\"The PP has 2 types of charging, with daily and one-time write-offs. When the daily cost of write-offs for the user ranging from 20 to 30 rubles. Good envelope shows two charging. When one-time write-offs have the ability to set an arbitrary price from 50 to 500 rubles. Depending on the quality of traffic to the optimal price for a one-time rebila is 150-250 rubles.\";}',4,1,3),(19,'a:2:{s:2:\"ru\";s:60:\"Что такое кредитование подписок?\";s:2:\"en\";s:31:\"What is a credit subscriptions?\";}','a:2:{s:2:\"ru\";s:269:\"Кредитование это авансовый платеж за новые подписки, с фиксированной ставкой. Более подробно о кредитовании можно прочитать в профильном разделе.\";s:2:\"en\";s:131:\"Credit is an advance payment for new subscriptions, fixed rate. More information about lending can be found in the profile section.\";}',5,1,3),(20,'a:2:{s:2:\"ru\";s:61:\"Как работает авто выкуп подписок?\";s:2:\"en\";s:44:\"How does the purchase of cars subscriptions?\";}','a:2:{s:2:\"ru\";s:404:\"Автоматический выкуп подписок позволяет после первого ребила получить фиксированную выплату за подписку. Преимущества автовыкупа в том, что не нужно ждать определенный период для окупаемости, а можно сразу работать в +.\";s:2:\"en\";s:217:\"Automatic redemption subscriptions allowing the first rebila receive a fixed payment for a subscription. Benefits autorepayment that do not need to wait for a certain period of payback, and you can immediately work. +\";}',6,1,3),(21,'a:2:{s:2:\"ru\";s:59:\"Для чего нужна страховка выплат?\";s:2:\"en\";s:31:\"What is the insurance payments?\";}','a:2:{s:2:\"ru\";s:167:\"Страховка выплат позволяет застраховать подписки от возможных проблем со стороны ОСС и КП.\";s:2:\"en\";s:94:\"Insurance payments allows to insure the subscription of possible problems from the OSS and CS.\";}',7,1,3),(22,'a:2:{s:2:\"ru\";s:67:\"Можно ли заказать досрочные выплаты?\";s:2:\"en\";s:42:\"Is it possible to order the early payment?\";}','a:2:{s:2:\"ru\";s:302:\"Да такая функция есть в партнерской программе. Вы можете заказать досрочные выплаты, не дожидаясь расчетного периода. Досрочные выплаты можно заказать в любой день.\";s:2:\"en\";s:171:\"Yes, such a function is in the affiliate program. You can order an early payment, without waiting for the settlement period. Early payments are available on any given day.\";}',8,1,3),(23,'a:2:{s:2:\"ru\";s:30:\"Общие положения:\";s:2:\"en\";s:19:\"General Provisions:\";}','a:2:{s:2:\"ru\";s:992:\"<ul><li>Соглашение регламентирует условия, и порядок предоставления услуг партнерской программой партнеру.</li>\n<li>Стороны признают настоящее соглашение имеющим юридическую силу, и равнозначным договору заключенном в письменной форме.</li>\n<li>Партнерская программа вправе изменить или дополнить условия данного соглашения в одностороннем порядке, но обязана уведомить об этом партнеров.</li>\n<li>Начиная работу с партнерской программой партнер принимает и акцептирует данное соглашение а так же соглашается с обработкой персональных данных.</li></ul>\";s:2:\"en\";s:516:\"<ul><li>The agreement regulates the conditions and procedure for granting services affiliate partner program.</li>\n<li>The Parties recognize this agreement legally binding and equivalent to the contract concluded in writing.</li>\n<li>Affiliates have the right to change or supplement the terms of the agreement unilaterally, but is obliged to notify partners.</li>\n<li>Starting work with the affiliate program partner receives and accepts this agreement as well as agree to the processing of personal data.</li></ul>\";}',1,1,4),(24,'a:2:{s:2:\"ru\";s:50:\"Права и обязанности сторон:\";s:2:\"en\";s:38:\"Rights and Obligations of the parties:\";}','a:2:{s:2:\"ru\";s:4336:\"\n<ul><li>\n  Партнер обязуется:\n    <ul><li>Ознакомиться с данным соглашением.</li>\n      <li>\n        Указывать достоверные реквизиты, а именно:<br />\n        - контактную информацию и email<br />\n        - платежные реквизиты\n      </li>\n      <li>Запрещено создавать топики на форумах, закрытого и открытого типа, без согласования с администрацией.</li>\n      <li>Оперативно (в течении 2х рабочих дней) реагировать на изменения в партнерской программе, касающиеся логики и правил работы и публикуемые в новостях. При необходимости вносить соответствующие правки.</li>\n      <li>Привлекать рефералов только законными методами.</li>\n      <li>\n      При любых проблемах, включая:<br />\n      - недоступность партнерской программы или лэндингов<br />\n      - задержку поступления средств после публикации новости о выплатах<br />\n      немедленно информировать техническую поддержку.\n      </li>\n      <li>\n        Использовать только законные методы привлечения трафика. Категорически запрещено:<br />\n        - использовать траффик добытый с помощью вредоносных и троянских программ, а так же с помощью подмены выдачи<br />\n        - осуществлять подписку вводя пользователя в заблуждение, или с помощью выманивания у последнего номера телефона и кода для активации подписки<br />\n        - использовать спам в любой форме, включая sms и email рассылку<br />\n        - использовать трафик с ресурсов содержащих: детскую порнографию, информацию о любых наркотиках, экстремистские либо другие запрещенные к публикации материалы.<br />\n        - выдавать платники под видом лицензионного контента: skype/viber/whatsapp/opera и т.д.<br />\n        - вводить пользователей в заблуждение используя в рекламе фразы и их производственные: бесплатно, халява, даром, а так же упоминание о детской порнографии, зоофилии, и .т.д.<br />\n        - использовать траффик с взломанных сайтов и шеллов<br />\n        - использовать в работе накрутку и фрод\n      </li>\n    </ul></li>\n  <li>\n  Партнерская программа обязуется:\n    <ul><li>Сохранять конфиденциальность партнеров, за исключением случаев нарушения правил партнерской программы.</li>\n      <li>Своевременно осуществлять плановые и досрочные выплаты согласно установленным срокам.</li>\n      <li>Оказывать партнеру услуги по конвертации мобильного траффика на лэндингах согласованных с ОСС.</li>\n      <li>Осуществлять техническую поддержку партнеров, связанную с использованием партнерской программы.</li>\n      <li>Своевременно информировать партнеров обо всех изменениях и нововведениях, посредством новостей.</li>\n    </ul></li>\n</ul>\";s:2:\"en\";s:2463:\"\n<ul><li>\n  Partner shall:\n    <ul><li>To view this agreement.</li>\n      <li>\n        Pointing accuracy of the details, namely:<br />\n        - Contact information and email<br />\n        - Payment details\n      </li>\n      <li>It is forbidden to create topics on the forums, closed and open, without the consent of the administration.</li>\n      <li>Promptly (within 2 business days) to respond to the changes in the affiliate program on the logic and rules of operation, and published in the news. If necessary, make the appropriate changes.</li>\n      <li>Attract referrals only by legal means.</li>\n      <li>\n        If you experience problems, including:<br />\n        - Lack of access to the affiliate program or Landing<br />\n        - Delay in inflows after the publication of news about payments<br />\n        immediately inform the technical support.\n      </li>\n      <li>\n        Use only legitimate methods to attract traffic. Absolutely forbidden:<br />\n        - Use the traffic produced by a malware and Trojans, as well as with the help of the substitution of issue<br />\n        - To subscribe to mislead users or by defrauding the latter telephone number and a code to activate your subscription<br />\n        - Use spam in any form, including sms and email newsletter<br />\n        - Use traffic from resources containing: child pornography, information on any drugs, extremist or other prohibited materials for publication.<br />\n        - Paysite issue under the guise of licensed content: skype / viber / whatsapp / opera etc.<br />\n        - Mislead users by using the phrase in advertising and production: free, freebies, for free, as well as references to child pornography, bestiality, and .t.d.<br />\n        - Use traffic from hacked websites and shells<br />\n        - To use the cheat and fraud\n      </li>\n    </ul></li>\n  <li>\n  Affiliate program shall:\n    <ul><li>Maintain the confidentiality of the partners, with the exception of cases of violation of the rules of the affiliate program.</li>\n      <li>In a timely manner to carry out scheduled and early payment in accordance with established deadlines.</li>\n      <li>Assist the partner services in converting traffic to mobile Landing agreed with OSS.</li>\n      <li>Provide technical support to partners associated with the use of affiliate programs.</li>\n      <li>Timely inform partners about all the changes and innovations through the news.</li>\n    </ul></li>\n</ul>\";}',2,1,4),(25,'a:2:{s:2:\"ru\";s:54:\"Ограничения ответственности:\";s:2:\"en\";s:25:\"Limitations of Liability:\";}','a:2:{s:2:\"ru\";s:763:\"<ul><li>Партнерская программа не несет ответственности за любые проблемы связанные с нарушением партнером правил партнерской программы.</li>\n<li>Партнерская программа не несет ответственности за финансовые убытки связанные с неправильным использованием, либо нарушением правил партнерской программы партнером.</li>\n<li>Партнерская программа не несет ответственности за любые проблемы возникшие по вине третьих лиц.</li></ul>\";s:2:\"en\";s:388:\"<ul><li>Affiliate program is not responsible for any problems related to the violation of the rules of the affiliate program partner.</li>\n<li>Affiliates shall not be liable for financial damages resulting from misuse or violation of the rules of the affiliate program partner.</li>\n<li>Affiliate program is not responsible for any problems caused by the fault of third parties.</li></ul>\";}',3,1,4),(26,'a:2:{s:2:\"ru\";s:64:\"Партнерская программа имеет право:\";s:2:\"en\";s:30:\"Affiliate program is entitled:\";}','a:2:{s:2:\"ru\";s:891:\"<ul><li>Приостанавливать работу партнерской программы для проведения плановых работ, обновления программного обеспечения и модернизации оборудования.</li>\n<li>Выставлять партнеру штрафы выставленные ОСС либо КП в полном объеме, в случае если причиной данного штрафа было нарушение правил партнерской программы партнером.</li>\n<li>В случае нарушения правил партнерской программы со стороны партнера – заблокировать аккаунт, с частичной или полной блокировкой средств на счету партнера.</li></ul>\";s:2:\"en\";s:446:\"<ul><li>Pauses the affiliate program for planned works, software updates and hardware upgrades.</li>\n<li>Expose partner penalties exposed OSS or manual in its entirety, if the reason for this penalty was a violation of the rules of the affiliate program partner.</li>\n<li>In case of violation of the rules of the affiliate program from a partner - to block the account, with partial or complete blocking of funds in the account partner.</li></ul>\";}',4,1,4);
