  `template` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `header` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `is_news` tinyint(1) unsigned NOT NULL DEFAULT 0,
  `emails_language` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
